import { NavLink } from "react-router-dom";
import classes from './navbar.module.css';
import userpic from './userpic.png'

const Navbar: React.FC = () =>{
    return(
        <header>
            <div className={classes.content}>
                <NavLink to="/" className={navData => navData.isActive ? classes['active-link'] : classes['inactive-link']} >PEARS</NavLink>
                <NavLink to="/swipes" className={navData => navData.isActive ? classes['active-link'] : classes['inactive-link']} >Swipes</NavLink>
                <NavLink to="/profile" className={navData => navData.isActive ? classes['active-link'] : classes['inactive-link']} ><img src={userpic} alt="Profile" /></NavLink>
            </div>
        </header>    
    )
}

export default Navbar;
